import ReactDOM from "react-dom";

import * as React from "react";

function Render(RenderObject) {
  ReactDOM.render(<RenderObject />, document.getElementById("root"));
}

function Card(){
  return (
    <div>
      <div class="col-md-4 mb-3">
            <div class="card">
              <img src={"werk"} class="card-img-top" alt="..." />
              <div class="card-body">
                <h3 class="card-text">
                  Werk
                </h3>
                <p>This app is going to be office/company productivity app, that will has bunches of functionalities including department chat, department report form, etc.
                </p>
                <ul class="list-group list-group-flush">
                  <li class="list-group-item"></li>
                  <li class="list-group-item">Technology: Flutter</li>
                  <li class="list-group-item">API: Firebase API</li>
                  <li class="list-group-item">Database: Firebase Cloud Firestore</li>
                  <li class="list-group-item"></li>
                  <a href="https://github.com/thepirateboy/werk" class="btn btn-primary">Take me there!</a>
                </ul>
              </div>
            </div>
          </div>
    </div>
  )
}

export {Render, Card};
